	queries.push('"'
			+ "SELECT " 
			+ "'" + event.n + event.e + "' as eventid, "
			+ "MIN(" + event.y + ") as lat, " 
			+ "MIN(" + event.x + ") as lon, "
			+ "get_region_name(" + event.y + ", " + event.x + ", 'L') as actual, "

			+ "FROM feplus "
			+ "GROUP BY eventid, actual, expected "
			+ "HAVING actual <> expected"
			+ '"');
